import React from 'react';
import { Button } from '../../atoms';

const BtnDelete = ({ onClick, pokeIdx })=>{
    return (
        <Button btnIcon='trash' onClick={() => onClick(pokeIdx)}/>
    )
}

export default BtnDelete;
